import re

data = items[0]['json'].get('body', {})
invoices = data.get('invoices', [])

errors = []

for idx, inv in enumerate(invoices):
    # Ignore la ligne "Total Restaurant - Strap" (ou toute ligne avec restaurantName contenant "Total")
    if "Total" in inv.get('restaurantName', ''):
        continue  # Skip validation pour cette ligne

    prefix = f"Facture {idx+1}"

    # Champs obligatoires seulement pour les vraies factures
    if 'address' not in inv or not inv['address'].strip():
        errors.append(f"{prefix}: address manquant")

    if 'restaurantName' not in inv or not inv['restaurantName']:
        errors.append(f"{prefix}: restaurantName manquant")

return [{'json': {
    'valid': len(errors) == 0,
    'errors': errors,
    'invoices': invoices,
    'totalInvoices': data.get('totalInvoices')
}}]

